import './Title.css';
import ReturnDate from './Date';
import ReturnMoonganoMoney from './MoonganoMoney';


export default function ReturnTitleActif() {
 return (
  <div className='wrp-title-actif-money'>
   <ReturnDate />

   <ReturnMoonganoMoney Text={`E-Money`} />
   <ReturnMoonganoMoney Text={`Communication`} />

   <ReturnMoonganoMoney Text={`E-Money`} />
   <ReturnMoonganoMoney Text={`Communication`} />

   <ReturnMoonganoMoney Text={`E-Money`} />
   <ReturnMoonganoMoney Text={`E-Money-Disponible`} />

  </div>
 );
};
